import axios from 'axios';


export const deploy = async (contractName, contractTokenSymbol, contractBaseURI, contractSupply, contractPrice, provider, signer) => {

  console.log("here");
  console.log(contractName, contractTokenSymbol, contractBaseURI, contractSupply, contractPrice, provider, signer);

  const url = 'http://localhost:4000/';

  const data = {
    "contractName": contractName,
    "contractTokenSymbol": contractTokenSymbol,
    "contractBaseURI": contractBaseURI,
    "contractSupply": contractSupply,
    "contractPrice": contractPrice
  }

  axios.post('http://localhost:4000/deploy_contract/', data)
  .then(function (response) {
    console.log(response);
  })
  .catch(function (error) {
    console.log(error);
  });

};
